    <>
      <div className="container-details">
        <div className="head-rec">
          <p>PUBG 325 UC PINS (Global)</p>
        </div>
        <div className="pubgcard">
          <img src={uc} alt="uc" />
          <p>Delivery Mode: Digital Den Nepal Account</p>
        </div>
      </div>
    </>
  );
}
